There are plenty of reasons to keep an eye on Twilio&amp;lsquo;s initial public offering, like whether or not it will open the door for more tech IPOs. Here&amp;rsquo;s a small-but-fun one: The company has&amp;nbsp;organized a live coding event from the New York Stock Exchange.
Tomorrow morning, Twilio will bring three developers to the NYSE floor, where they&amp;rsquo;ll be trying to build as many apps as they can using the company&amp;rsquo;s voice and text messaging platform.
Three people doesn&amp;rsquo;t quite add up to a&amp;nbsp;full hackathon (the company&amp;rsquo;s calling it a &amp;ldquo;code jam&amp;rdquo;), but hey, it sounds a lot more interesting than just ringing the bell. Plus, it&amp;rsquo;s pretty on-brand for a developer platform like Twilio &amp;mdash; in fact, developer evangelist Rob Spectre told me via email that &amp;ldquo;cutting code is the way we celebrate everything at Twilio.&amp;rdquo;

