	 &amp;ldquo;Every time we have a new office, a new product or any other milestone along the way, we invite developers from our community over to make a bunch of new stuff,&amp;rdquo; he said. &amp;ldquo;It&amp;rsquo;s what we do. We had to do the same thing on Wall Street.&amp;rdquo;
Spectre will be one of the coders participating, along with Dropbox&amp;nbsp;developer advocate Leah Culver and fintech developer David Huerta.
You&amp;rsquo;ll be able to watch the event, which starts with the opening bell at&amp;nbsp;9:30am, live on Twitch.&amp;nbsp;When will it end? Spectre said, &amp;ldquo;Whenever they kick us out.&amp;rdquo;
